import React from 'react';
import Header from './components/Header';
import { useNavigate } from 'react-router-dom'
import { motion } from 'framer-motion'; 
import FetchDataFromStrava from './pages/FetchDataFromStrava';

const App = () => {
  const [selectedYear, setSelectedYear] = useState('');
  const [stats, setStats] = useState([]);
  const navigate = useNavigate();

  const handleClick = async () => {
    try {
      const data = await FetchDataFromStrava();
      setSelectedYear(new Date().getFullYear()); 
      // navigate('/stats', { state: { selectedYear: '2023', stats: data } });
    } catch (error) {
      console.log(error); 
    }
  }

  return (
    <div className="flex flex-col items-center justify-center h-screen"
    style={{backgroundColor:'rgb(255, 254, 247)'}}>
      <Header />
      <motion.button
        whileHover={{ scale: 1.1 }}
        whileTap={{ scale: 0.9 }}
        onClick={handleClick}
        className="bg-lightblue text-white font-wotfard text-xl py-2 px-4 rounded mt-4"
      >
        see my stats
      </motion.button>
    </div>
  );
};

export default App;
